import Logo from "../src/img/logo.png";

const Loading = () => {
    return (
        <div className="Loading">
            <img className="logoImage" src={Logo}></img>
            <div>
                <p>
                    스마트<span>폰 똑</span>똑하게 쓰기
                </p>
            </div>
        </div>
    );
};

export default Loading;
